    id: 1,
    image: 'https://upload.wikimedia.org/wikipedia/commons/thumb/e/ea/FPT_Software_logo.svg/1200px-FPT_Software_logo.svg.png',
    title: 'string',
    desc: 'string',
  },
  {
    id: 2,
    image: 'https://upload.wikimedia.org/wikipedia/commons/thumb/e/ea/FPT_Software_logo.svg/1200px-FPT_Software_logo.svg.png',
    title: 'string',
    desc: 'string',
  },
  {
    id: 3,
    image: 'https://upload.wikimedia.org/wikipedia/commons/thumb/e/ea/FPT_Software_logo.svg/1200px-FPT_Software_logo.svg.png',
    title: 'string',
    desc: 'string',
  },
];

const App = () => {
  return <ExampleComponent values={data} isAutoScroll delay={500} />
}

export default App
